import React from 'react'
import AttributeButton from './AttributeButton'

const FiltersBar = ({ setAttribute }) => {
    const f = (hero, s) => {
        return hero.attribute===s?true:false;
    }
    return (
        <div className="filters_bar">
            <div className="attributes_filter_container">
                <AttributeButton filter={(hero) => f(hero, "STR")} setAttribute={setAttribute}/>
                <AttributeButton filter={(hero) => f(hero, "AGI")} setAttribute={setAttribute}/>
                <AttributeButton filter={(hero) => f(hero, "INT")} setAttribute={setAttribute}/>
            </div>

        </div>
    )
}

export default FiltersBar
